syntax = "proto3";

option csharp_namespace = "LagrangeProto.service.oidb";
option java_multiple_files = true;
option java_package = "dev.lagrangecore.LagrangeProto.service.oidb";
option go_package = "LagrangeProto/system/service/oidb";

// Group Kick Member
message OidbSvcTrpcTcp0x8A0_1 {
  uint32 GroupUin = 1;
  string TargetUid = 3;
  bool RejectAddRequest = 4;
  string Field5 = 5;
}

message OidbSvcTrpcTcp0x8A0_1Response {
  uint32 GroupUin = 1;
  optional string ErrorMsg = 2;
}
